from typing import List
import time

class Solution:
    def threeSum(self, nums: List[int]) -> List[List[int]]:
        TARGET = 0
        # 2. 2sum solution
        n = len(nums)
        ans = set()
        marked = set()
        for i in range(n):
            num1 = nums[i]
            map = {}
            if num1 in marked:
                continue
            for j in range(i+1, n):
                num2 = nums[j]
                if num2 in map:
                    triplet = list(map[num2])
                    triplet.append(num2)
                    triplet.sort()
                    ans.add(tuple(triplet))
                map[TARGET - (num1 + num2)] = [num1, num2]
            marked.add(num1)
        # 1. Naive solution (Fails)
        # n = len(nums)
        # ans = set()
        # for i in range(n):
        #     num1 = nums[i]
        #     for j in range(i+1, n):
        #         num2 = nums[j]
        #         for k in range(j+1, n):
        #             num3 = nums[k]
        #             if num1 + num2 + num3 == 0:
        #                 triplet = [num1,num2,num3]
        #                 triplet.sort()
        #                 ans.add(tuple(triplet))

        # print(ans)
        return ans

